/* eslint-disable */ 

import './App.css';

//외부에서 생성한 컴포넌트를 가져온다.
import Box from './Box';
import BoxChange from './BoxChange';

function App() {
  return (
    <div className="App">
      <Box/>
      <Box/>

      <BoxChange name = "test 01"/>
      <BoxChange name = "test 02"/>
      <BoxChange name = "test 03"/>
    </div>
  );
}

export default App;
